import {useState} from 'React';
import Navbar from './Navbar';
import Footer from './Footer';

export const Main = () => {
    const [value, setValue] = useState();    
    return (
        <>
        <Navbar setValue={setValue}/>
            Value of item is {value}
        <Footer />
        </>
    )
}
